import EnderBar from '../complex/EnderBar';
import NavLinkBar from '../complex/NavLinkBar';
import NavTitleBar from '../complex/NavTitleBar';
import React from 'react';

// CURRENT VALUES ADDED TO NAVBAR
const NAV_LINKS = ['Club News', 'Trips', 'Equipment', 'About Us', 'Contact Us'];
const ON_CLICKS = [
    () => console.log('Club news'),
    () => console.log('Trips'),
    () => console.log('Equipment'),
    () => console.log('About Us'),
    () => console.log('Contact Us')
];

const NAVBAR_WIDTH = '100%';

type NavBarProps = {
    navLinks: string[];
    onClicks: (() => void)[];
};

export default class NavBar extends React.Component<NavBarProps, any> {
    props: NavBarProps;

    constructor(props: NavBarProps) {
        super(props);
        this.props = props;
    }

    containerStyle = () => {
        return {
            display: 'flex',
            width: NAVBAR_WIDTH,
            boxShadow: '0 2px 3px #000'
        };
    };

    render = () => {
        return (
            <div style={this.containerStyle()}>
                <NavTitleBar />
                <NavLinkBar navLinks={this.props.navLinks} onClicks={this.props.onClicks} />
                <EnderBar />
            </div>
        );
    };
}
